import React, { useState, useEffect } from "react";
import api from '../../services/services';
import { Link } from "react-router-dom"
import { Container } from "./HomeStyle";

export default function Home() {
    const [usuarios, setUsuarios] = useState(undefined);
    const [page, setPage] = useState(1);
    const [apiInfo, setApiInfo] = useState(undefined);

    const [showInfo, setShowInfo] = useState(false);

    useEffect(()=>{
        loadUsuarios();
    },[])

    useEffect(()=>{
        if(usuarios !== undefined) {
            setShowInfo(true);
            console.log(usuarios);
        }
    },[usuarios]);

    async function loadUsuarios() {
        const response = await api.get(`/persons`);

        const { docs, ...usuariosInfo } = response.data;
        console.log(docs)

        setApiInfo(usuariosInfo);
        setUsuarios(docs);
    }

    return (
        <div>
            <Container className="container">
                <h1>Listagem de pessoas</h1>
                <fieldset>
                    <div className="row">
                        <div className="col col-lg-3 user-insert">
                            <label htmlFor="">Código</label>
                            <input type="text" />
                        </div>
                        <div className="user-insert">
                            <label htmlFor="">Nome Fantasia</label>
                            <input type="text" />
                        </div>
                    </div>
                    <div className="row">
                        <div className="user-insert">
                            <label htmlFor="">Razão Social</label>
                            <input type="text" />
                        </div>
                        <button>Filtrar</button>
                    </div>
                </fieldset>
                <div className="row">
                    <button>Incluir</button>
                </div>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">Código</th>
                            <th scope="col">Nome</th>
                            <th scope="col">Cidade</th>
                            <th scope="col">UF</th>
                            <th scope="col">Ações</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <th scope="row">3</th>
                            <td>Larry the Bird</td>
                            <td>@twitter</td>
                            <td>@mdo</td>
                            <td>@mdo</td>
                        </tr>
                    </tbody>
                </table>
            </Container>

        </div>
    )
}
